import React from "react";
import InsideCornerBottomRightImage from './res/insidecornerbottomright.jpg';
import './Tile.css'

const InsideCornerBottomRight = () => {
    return (
        <img className="myTileImg" src={InsideCornerBottomRightImage}/>
    )
};

export default InsideCornerBottomRight;
